import React from 'react'
import { storiesOf } from '@storybook/react'
import { withKnobs, text, object } from '@storybook/addon-knobs/react'
import { withReadme } from 'storybook-readme'
import { withState } from '@dump247/storybook-state'
import AtiButton from './../button/AtiButton'
import AtiImageCropperMd from './AtiImageCropper.md'
import AtiImageCropper from './AtiImageCropper'

const getCroppedImg = (image, pixelCrop) => {
  image.crossOrigin = 'Anonymous'
  const canvas = document.createElement('canvas')
  canvas.width = pixelCrop.width
  canvas.height = pixelCrop.height
  const ctx = canvas.getContext('2d')

  ctx.drawImage(
    image,
    pixelCrop.x,
    pixelCrop.y,
    pixelCrop.width,
    pixelCrop.height,
    0,
    0,
    pixelCrop.width,
    pixelCrop.height
  )

  // As Base64 string
  const base64Image = canvas.toDataURL('image/jpeg')

  return base64Image
}

storiesOf('Image Cropper', module)
  .addDecorator(withKnobs)
  .addDecorator(getStory => <div style={{padding: '20px'}}>{getStory()}</div>)
  .addDecorator(withReadme(AtiImageCropperMd))
  .addWithDoc('Image Cropper', AtiImageCropper, null, withState({image: null, pixelCrop: null})(({ store }) => {
    const url = 'data:image/jpeg;base64,'

    const crop = {
      x: 10,
      y: 10,
      width: 80,
      height: 80
    }

    const handleImageLoaded = image => {
      //console.log('loadedImage', image)
    }

    const handleCropComplete = (crop, pixelCrop) => {
      store.set({pixelCrop: pixelCrop})
      //console.log('pixelCrop', store.state.pixelCrop)
    }

    const getCropped = () => {
      const result = getCroppedImg(createImageElement(), store.state.pixelCrop)
      const img = document.createElement('img')
      img.src = result

      const element = document.getElementById('imageDiv')

      element.appendChild(img)
    }

    const createImageElement = () => {
      const img = document.createElement('img')
      img.className = 'ReactCrop__image'
      img.src = url
      img.alt = ''
      return img
    }

    return (
      <div>
        <AtiImageCropper
          src={text('URL', url)}
          crop={object('crop', crop)}
          events={{
            onCropComplete: handleCropComplete,
            onImageLoaded: handleImageLoaded
          }} />
        <AtiButton type='button' block={true} events={{onClick: getCropped}} text='Get Cropped Image' />
        <div id='imageDiv' />
      </div>

    )
  }
  ))
